import React, { useState } from 'react';
import { Layout, Table, Card, Button, Row, Col, Modal, Form, Input, DatePicker } from 'antd';
import { BellOutlined } from '@ant-design/icons';
import { Link } from 'react-router-dom';

const { Header, Content } = Layout;

const Dashboard = () => {
  // State to control modal visibility
  const [isModalVisible, setIsModalVisible] = useState(false);

  // Function to show the modal
  const showModal = () => {
    setIsModalVisible(true);
  };

  // Function to handle modal cancel
  const handleCancel = () => {
    setIsModalVisible(false);
  };

  // Function to handle form submission
  const handleFormSubmit = (values) => {
    console.log('Form Submitted: ', values);
    setIsModalVisible(false); // Close modal after submission
  };

  // Hardcoded data for the table
  const dataSource = [
    { key: '1', customerName: 'Ahmad', issue: 'Computer Screen', startDate: '9/4/2024', deadline: '1 week', location: 'Khalda Amman sunshine company', technician: 'Rafi Barudak' },
    { key: '2', customerName: 'Ahmad', issue: 'Computer Screen', startDate: '9/4/2024', deadline: '1 week', location: 'Khalda Amman sunshine company', technician: 'Rafi Barudak' },
    { key: '3', customerName: 'Ahmad', issue: 'Computer Screen', startDate: '9/4/2024', deadline: '1 week', location: 'Khalda Amman sunshine company', technician: 'Rafi Barudak' },
  ];

  // Table columns
  const columns = [
    { title: 'Customer Name', dataIndex: 'customerName', key: 'customerName' },
    { title: 'Issues', dataIndex: 'issue', key: 'issue' },
    { title: 'Start Date', dataIndex: 'startDate', key: 'startDate' },
    { title: 'Deadline', dataIndex: 'deadline', key: 'deadline' },
    { title: 'Location', dataIndex: 'location', key: 'location' },
    { title: 'Technician', dataIndex: 'technician', key: 'technician' },
  ];

  return (
    <Layout style={{ backgroundColor: '#f0f2f5', minHeight: '100vh' }}>
      {/* Content */}
      <Content style={{ padding: '20px' }}>
        <h1 style={{ textAlign: 'center', marginBottom: '30px' }}>Customer Dashboard</h1>

        {/* Cards */}
        <Row gutter={16} justify="center" align="middle" style={{ marginBottom: '20px', textAlign: 'center' }}>
          <Col span={8}>
            <Card
              hoverable
              cover={
                <img
                  alt="Schedule Repair Appointment"
                  src="https://cdn.pixabay.com/photo/2016/03/27/07/08/clock-1281608_960_720.jpg"
                  style={{ objectFit: 'cover', height: '150px' }}
                />
              }
            >
              <Card.Meta title="Schedule Repair Appointment" description={<Button type="primary" onClick={showModal}>Schedule Now</Button>} />
            </Card>
          </Col>
          <Col span={8}>
            <Card
              hoverable
              cover={
                <img
                  alt="Submit a request"
                  src="https://cdn.pixabay.com/photo/2016/04/19/13/39/checklist-1331910_960_720.jpg"
                  style={{ objectFit: 'cover', height: '150px' }}
                />
              }
            >
              <Card.Meta title="Submit a request" description={<Button type="primary">Submit Now</Button>} />
            </Card>
          </Col>
        </Row>

        {/* Table */}
        <h2 style={{ textAlign: 'center', marginBottom: '20px' }}>History</h2>
        <Table dataSource={dataSource} columns={columns} pagination={false} />

        {/* Modal for scheduling repair */}
        <Modal
          title="Schedule Repair Appointment"
          visible={isModalVisible}
          onCancel={handleCancel}
          footer={null} // We handle submission via the form
        >
          <Form layout="vertical" onFinish={handleFormSubmit}>
            <Form.Item label="Title" name="title" rules={[{ required: true, message: 'Please input the title!' }]}>
              <Input placeholder="Enter title for the repair" />
            </Form.Item>

            <Form.Item label="Description" name="description" rules={[{ required: true, message: 'Please input a description!' }]}>
              <Input.TextArea placeholder="Enter a brief description" />
            </Form.Item>

            <Form.Item label="Select Date and Time" name="date" rules={[{ required: true, message: 'Please select a date and time!' }]}>
              <DatePicker showTime />
            </Form.Item>

            <Form.Item>
              <Button type="primary" htmlType="submit">
                Submit
              </Button>
            </Form.Item>
          </Form>
        </Modal>
      </Content>
    </Layout>
  );
};

export default Dashboard;
